(1, 1, 4, 'How to place an order on \"Daraz\"?', '<p>How to place an order on \"Daraz\"?</p><figure class=\"media\"><oembed url=\"https://www.youtube.com/embed/pKCB5Z_lfvs\"></oembed></figure><p>Please watch the following video to know about all the easy steps of placing an order on Daraz.<br>&nbsp;</p>', 0, 'how-to-place-an-order-on-daraz-ODcx', '2020-12-02 07:45:42', '2021-07-04 17:34:23'),
(2, 2, 1, 'How can I change the password of my account?', '<p>How can I change the password of my account?</p><p>If you forgot your password and need to know how to do it? So, please follow as per below:</p><p><strong>Step 1: </strong>Click on<strong> “Forgot Password”</strong>.</p><p><strong>Step 2: </strong>Add<strong> “Phone Number</strong>” Or <strong>“Email</strong>”.</p><p><strong>Step 3: </strong>Slide to Continue.</p><p><strong>Step 4: </strong>Verify through the way which is convenient for you.</p><p><strong>Step 5:</strong> Press “Send” to get the Verification Code on Email/SMS.</p><p><strong>Step 6: </strong>Click on<strong> “Verify Code”.</strong></p><p><strong>Step 7: </strong>Enter “New Password” and then “Retype Password”.</p><p>Hurry! your password has been reset.</p><figure class=\"image\"><img src=\"https://beebot-sg-knowledgecloud.oss-ap-southeast-1.aliyuncs.com/kc/kc-media/kc-oss-1586177953817-How%20to%20reset%20password.gif\"></figure>', 1, 'how-can-i-change-the-password-of-my-account-MTI0', '2020-12-02 08:56:41', '2020-12-02 09:34:19');
