38033#terms\">Back to Top</a><br><br>&nbsp;</p><h4>I. OTHERS</h4><ul><li><strong>Stock availability:</strong> The orders are subject to availability of stock.</li><li><strong>Delivery Timeline:</strong> The delivery might take longer than usual timeframe/line to be followed by Daraz.<br>Delivery might be delayed due to force majeure event which includes, but not limited to, political unrest, political event, national/public holidays,etc</li><li><strong>Cancellation:</strong> Daraz retains unqualified right to cancel any order at its sole discretion prior to dispatch and for any reason which may include, but not limited to, the product being mispriced, out of stock, expired, defective, malfunctioned, and containing incorrect information or description arising out of technical or typographical error or for any other reason.</li><li><strong>Refund Timeline:</strong> If any order is canceled, the payment against such order shall be refunded within 10 to 15 working days, but it may take longer time in exceptional cases. Provided that received cash back amount, if any, will be adjusted with the refund amount.</li></ul><p><a href=\"https://www.daraz.com.bd/wow/i/bd/help-pages/terms-and-conditions/?spm=a2a0e.home.footer_top.15.73524591pRuBqt&amp;scm=1003.4.icms-zebra-100022982-2888463.OTHER_5476361488_2538033#terms\">Back to Top</a><br><br>You confirm that the product(s) or service(s) ordered by you are purchased for your internal / personal consumption and not for commercial re-sale. You authorize us to declare and provide declaration to any governmental authority on your behalf stating the aforesaid purpose for your orders on the Site. The Seller or the Site may cancel an order wherein the quantities exceed the typical individual consumption. This applies both to the number of products ordered within a single order and the placing of several orders for the same product where the individual orders comprise a quantity that exceeds the typical individual consumption. What comprises a typical individual\'s consumption quantity limit shall be based on various factors and at the sole discretion of the Seller or ours and may vary from individual to individual.<br><br>You may cancel your order at no cost any time before the item is dispatched to you.<br><br>Please note that we sell products only in quantities which correspond to the typical needs of an average household. This applies both to the number of products ordered within a single order and the placing of several orders for the same product where the individual orders comprise a quantity typical for a normal household.Please review our Refund Policy <a href=\"https://www.daraz.com.bd/wow/i/bd/help-pages/refunds-policy?hybrid=1\">here</a>.</p>', NULL, '<p>Welcome to the daraz.com.bd website (the \"Site\") operated by Daraz Bangladesh Ltd. We respect your privacy and want to protect your personal information. To learn more, please read this Privacy Policy.<br><br>This Privacy Policy explains how we collect, use and (under certain conditions) disclose your personal information. This Privacy Policy also explains the steps we have taken to secure your personal information. Finally, this Privacy Policy explains your options regarding the collection, use and disclosure of your personal information. By visiting the Site directly or through another site, you accept the practices described in this Policy.<br><br>Data protection is a matter of trust and your privacy is important to us. We shall therefore only use your name and other information which relates to you in the manner set out in this Privacy Policy. We will only collect information where it is necessary for us to do so and we will only collect information if it is relevant to our dealings with you.<br><br>We will only keep your information for as long as we are either required to by law or as is relevant for the purposes for which it was collected.<br><br>You can visit the Site and browse without having to provide personal details. During your visit to the Site you remain anonymous and at no time can we identify you unless you have an account on the Site and log on with your user name and password.</p><h4>1. Data that we collect</h4><p>We may collect various pieces of information if you seek to place an order for a product with us on the Site.<br><br>We collect, store and process your data for processing your purchase on the Site and any possible later claims, and to provide you with our services. We may collect personal information including, but not limited to, your title, name, gender, date of birth, email address, postal address, delivery address (if different), telephone number, mobile number, fax number, payment details, payment card details or bank account details.<br><br>We will use the information you provide to enable us to process your orders and to provide you with the services and information offered through our website and which you request. Further, we will use the information you provide to administer your account with us; verify and carry out financial transactions in relation to payments you make; audit the downloading of data from our website; improve the layout and/or content of the pages of our website and customize them for users; identify visitors on our website; carry out research on our users\' demographics; send you information we think you may find useful or which you have requested from us, including information about our products and services, provided you have indicated that you have not objected to being contacted for these purposes. Subject to obtaining your consent we may contact you by email with details of other products and services. If you prefer not to receive any marketing communications from us, you can opt out at any time.<br><br>We may pass your name and address on to a third party in order to make delivery of the product to you (for example to our courier or supplier). You must only submit to us the Site information which is accurate and not misleading and you must keep it up to date and inform us of changes.<br><br>Your actual order details may be stored with us but for security reasons cannot be retrieved directly by us. However, you may access this information by logging into your account on the Site. Here you can view the details of your orders that have been completed, those which are open and those which are shortly to be dispatched and administer your address details, bank details ( for refund purposes) and any newsletter to which you may have subscribed. You undertake to treat the personal access data confidentially and not make it available to unauthorized third parties. We cannot assume any liability for misuse of passwords unless this misuse is our fault.</p><h4>Other uses of your Personal Information</h4><p>We may use your personal information for opinion and market research. Your details are anonymous and will only be used for statistical purposes. You can choose to opt out of this at any time. Any answers to surveys or opinion polls we may ask you to complete will not be forwarded on to third parties. Disclosing your email address is only necessary if you would like to take part in competitions. We save the answers to our surveys separately from your email address.<br><br>We may also send you other information about us, the Site, our other websites, our products, sales promotions, our newsletters, anything relating to other companies in our group or our business partners. If you would prefer not to receive any of this additional information as detailed in this paragraph (or any part of it) please click the \'unsubscribe\' link in any email that we send to you. Within 7 working days (days which are neither (i) a Sunday, nor (ii) a public holiday anywhere in Bangladesh) of receipt of your instruction we will cease to send you information as requested. If your instruction is unclear we will contact you for clarification.<br><br>We may further anonymize data about users of the Site generally and use it for various purposes, including ascertaining the general location of the users and usage of certain aspects of the Site or a link contained in an email to those registered to receive them, and supplying that anonymized data to third parties such as publishers. However, that anonymized data will not be capable of identifying you personally.</p><h4>Competitions</h4><p>For any competition we use the data to notify winners and advertise our offers. You can find more details where applicable in our participation terms for the respective competition.</p><h4>Third Parties and Links</h4><p>We may pass your details to other companies in our group. We may also pass your details to our agents and subcontractors to help us with any of our uses of your data set out in our Privacy Policy. For example, we may use third parties to assist us with delivering products to you, to help us to collect payments from you, to analyze data and to provide us with marketing or customer service assistance.<br><br>We may exchange information with third parties for the purposes of fraud protection and credit risk reduction. We may transfer our databases containing your personal information if we sell our business or part of it. Other than as set out in this Privacy Policy, we shall NOT sell or disclose your personal data to third parties without obtaining your prior consent unless this is necessary for the purposes set out in this Privacy Policy or unless we are required to do so by law. The Site may contain advertising of third parties and links to other sites or frames of other sites. Please be aware that we are not responsible for the privacy practices or content of those third parties or other sites, nor for any third party to whom we transfer your data in accordance with our Privacy Policy.</p><h4>2. Cookies</h4><p>The acceptance of cookies is not a requirement for visiting the Site. However we would like to point out that the use of the \'basket\' functionality on the Site and ordering is only possible with the activation of cookies. Cookies are tiny text files which identify your computer to our server as a unique user when you visit certain pages on the Site and they are stored by your Internet browser on your computer\'s hard drive. Cookies can be used to recognize your Internet Protocol address, saving you time while you are on, or want to enter, the Site. We only use cookies for your convenience in using the Site (for example to remember who you are when you want to amend your shopping cart without having to re-enter your email address) and not for obtaining or using any other information about you (for example targeted advertising). Your browser can be set to not accept cookies, but this would restrict your use of the Site. Please accept our assurance that our use of cookies does not contain any personal or private details and are free from viruses. If you want to find out more information about cookies, go to http://www.allaboutcookies.org or to find out about removing them from your browser, go to http://www.allaboutcookies.org/manage-cookies/index.html.<br><br>This website uses Google Analytics, a web analytics service provided by Google, Inc. (\"Google\"). Google Analytics uses cookies, which are text files placed on your computer, to help the website analyze how users use the site. The information generated by the cookie about your use of the website (including your IP address) will be transmitted to and stored by Google on servers in the United States. Google will use this information for the purpose of evaluating your use of the website, compiling reports on website activity for website operators and providing other services relating to website activity and internet usage. Google may also transfer this information to third parties where required to do so by law, or where such third parties process the information on Google\'s behalf. Google will not associate your IP address with any other data held by Google. You may refuse the use of cookies by selecting the appropriate settings on your browser, however please note that if you do this you may not be able to use the full functionality of this website. By using this website, you consent to the processing of data about you by Google in the manner and for the purposes set out above.</p><h4>3. Security</h4><p>We have in place appropriate technical and security measures to prevent unauthorized or unlawful access to or accidental loss of or destruction or damage to your information. When we collect data through the Site, we collect your personal details on a secure server. We use firewalls on our servers. Our security procedures mean that we may occasionally request proof of identity before we disclose personal information to you. You are responsible for protecting against unauthorized access to your password and to your computer.</p><h4>4. Your rights</h4><p>If you are concerned about your data you have the right to request access to the personal data which we may hold or process about you. You have the right to require us to correct any inaccuracies in your data free of charge. At any stage you also have the right to ask us to stop using your personal data for direct marketing purposes.</p>', NULL, '<h4>In the course of our long work timeline, we realize that we need to make a common platform that can help to communicate with experienced engineers, architect construction companies.&nbsp;Tizaara makes an online common platform between buyer and seller which makes smile each other.</h4><h4>&nbsp;</h4><h4>This is the first online civil engineering services &amp; building products where we can communicate with buyers and suppliers easily. &nbsp;&nbsp;&nbsp; &nbsp;</h4><h3>&nbsp;</h3><h3><strong>Mission&nbsp;</strong></h3><blockquote><h4>Making Trade Easier&nbsp;</h4></blockquote><p>&nbsp;</p><p>&nbsp;</p><h3>&nbsp;</h3>', '<p><strong>Tizaara is the largest online B2B marketplace in India</strong>, with over&nbsp;<strong>6.1 Mn suppliers</strong>,&nbsp;<strong>102 Mn buyers</strong>&nbsp;and&nbsp;<strong>3,150 employees</strong>. Join us as a&nbsp;<strong>Sales Associate</strong>&nbsp;or asa a&nbsp;<strong>Channel Partner</strong>&nbsp;and be a part of this large ecosystem and explore exciting new possibilities for achieving greater success.</p><figure class=\"image\"><img src=\"https://corporate.indiamart.com/wp-content/uploads/2020/09/sales-associate-2.jpg\" alt=\"\"></figure><figure class=\"image\"><img src=\"https://corporate.indiamart.com/wp-content/uploads/2020/09/channel-partner-3.jpg\" alt=\"\"></figure><p>&nbsp;</p><h2><strong>Why Become our Sales Associate/Channel Partner:</strong></h2><p>Build a rewarding career for yourself. Become a sales associate/channel partner with us. Enjoy flexible work hours, financial freedom, training, support wherein individuals can earn 1.2 Lac to 3.6 Lac or more per annum.&nbsp;Channel partners can earn a healthy return on investment (ROI) depending upon the no of agents (no limit) and other factors.</p><p>&nbsp;</p><h2><strong>Who can partner with us</strong>?</h2><p>If you are a graduate and financial freedom, flexibility, and success are your goals, then this is the perfect opportunity for you. All you need to bring is an open mind and the willingness to learn, grow and excel. Come and be a part of our growth journey.</p><h2><strong>How to Become an IndiaMART Sales Associate/Partner?</strong></h2><p><i>All the below-mentioned steps are either online or telephonic.</i></p><figure class=\"image\"><img src=\"https://corporate.indiamart.com/wp-content/uploads/2020/09/step-follow-banner-1.jpg\" alt=\"\"></figure><p><i><strong>Training : Learn everything in a week’s time.</strong></i></p><p>&nbsp;</p><h2><strong>Fly High &amp; Start Earning</strong>!</h2><figure class=\"image\"><img src=\"https://corporate.indiamart.com/wp-content/uploads/2020/09/sales-associate-2.jpg\" alt=\"\"></figure><figure class=\"image\"><img src=\"https://corporate.indiamart.com/wp-content/uploads/2020/09/channel-partner-3.jpg\" alt=\"\"></figure>', '2020-11-28 02:17:22', '2021-06-02 12:06:34');
